import React, { Component } from "react";

class Mitglieder extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <h2
          id="Mitglieder"
          style="margin-top: 3em; margin-left: 2em; margin-bottom: 1em;"
        >
          Mitglieder des Bundestages
        </h2>
        <iframe
          src="http://localhost:8000/query2_table"
          title="Mitglieder table"
          style="table-layout: fixed;width: 50%; border-collapse: collapse; border: 1px solid rgb(17, 198, 44); text-align: center;"
        ></iframe>
      </React.Fragment>
    );
  }
}

export default Mitglieder;
